export function LuckyDrawForm(){
    return(
        <div>
        <div>
          <input
            type="text"
            placeholder="Enter Participant Name"
          />
          <button onClick="">Add Participant</button>
        </div>
        <div>
          <button onClick="">Pick Winner</button>
        
        </div>
        </div>
    );
}


export default LuckyDrawForm;
